import React from "react";
import styles from './Pagination.module.css';

const Pagination = () => {
  return (
      <ul className={styles.pagination}>
      <li>
        <a href="!#">&lt;</a>
      </li>
          <li className={styles.pagination.act}>
        <a href="!#">1</a>
      </li>
      <li>
        <a href="!#">2</a>
      </li>
      <li>
        <a href="!#">3</a>
      </li>
      <li>
        <a href="!#">&gt;</a>
      </li>
    </ul>
  );
};

export default Pagination;
